import React from "react";
import { Container, Button } from "../index";
import "./style.scss";

function Contact() {
	return (
		<div className="contact">
			<Container>
				<p>Get in touch title</p>
				<p>Get in touch copy</p>
				<Button 
					label="Get in touch via email"
				/>
			</Container>
		</div>
	);
}

export default Contact;
